import React from "react";

function Search({setCategory, selectedCategory, categories, searchInput, setSearchInput}){
    return (
        <div className="search-bar">
            <button className="category-button">All</button>
            <button className="category-button">Protein</button>
            <input 
            className="search-input"
            type="text" 
            value={searchInput}
            onChange={(e) => setSearchInput(e.target.value)}
            placeholder="Search recipe..."
            />
            <button className="category-button">Vegan</button>
            <button className="category-button">Soup</button>
        </div>
    )
}

export default Search;
